import React from "react";
import "../../../Styles/Pages/ToSell/ToSellSecond.scss";
import PublicIcon from "@material-ui/icons/Public";
import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";
import LanguageIcon from "@material-ui/icons/Language";
import PeopleAltIcon from "@material-ui/icons/PeopleAlt";
import CreditCardIcon from "@material-ui/icons/CreditCard";

function ToSellSecond() {
  return (
    <div className='toSellSecond'>
      <div className='toSell__col'>
        <div className='toSell__img'>
          <PublicIcon />
        </div>
        <p>Start Selling in 200+ Countries & Territories</p>
      </div>
      <div className='toSell__col'>
        <div className='toSell__img'>
          <PublicIcon />
        </div>
        <p>Start Selling in 200+ Countries & Territories</p>
      </div>
      <div className='toSell__col'>
        <div className='toSell__img'>
          <PublicIcon />
        </div>
        <p>Start Selling in 200+ Countries & Territories</p>
      </div>
      <div className='toSell__col'>
        <div className='toSell__img'>
          <PublicIcon />
        </div>
        <p>Start Selling in 200+ Countries & Territories</p>
      </div>
    </div>
  );
}

export default ToSellSecond;
